import React from "react"
import MainPage from "./MainPage"
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Sidebar from "./Sidebar";
import Signup from "./Signup";

const App = () => {
    return (
        <>
            <BrowserRouter>
                <Sidebar />
                
                <Routes>
                    <Route path="./signup" element={Signup}></Route>
                </Routes>
            </BrowserRouter>
        </>
    )
};

export default App;
